    gfloat sradMean=0.0f, sradAcc=0.0f;
    for (gint32 i = 1; i < rmax; i++)
    {
      sradAcc += srad[i];
    }
    sradMean = sradAcc / rmax;

    // variance
    gfloat sradVariance=0.0f;
    sradAcc = 0.0f;
    for (gint32 i = 1; i < rmax; i++)
    {
      sradAcc += (srad[i] - sradMean)*(srad[i] - sradMean);
    }
    sradVariance = sradAcc / rmax;

