    gfloat sradDistance = (sradMean - sradMax) > 0 ? (sradMean - sradMax) : (-1)*(sradMean - sradMax);

    /***************************/
    // spectral features sang
    // max
    gfloat angMax = sang[1];
    gfloat angMaxloc = 1;
