// compute coordinates of a halfcircle around x0 y0 with radius r.
void halfcircle(gint32 r, gint32* xc, gint32* yc, gint32 x0, gint32 y0, gfloat* out)
{
    gfloat theta[180];
    gint32 array_index;
    //int n = x0*2;
    /*
    // for testing;
    for(int i = 0; i < n; i++)
    {
      for (int j = 0; j < n; j++)
      {
          out[i*n + j] = 0.0;
      }
    }
    */
    for( gint32 angle = 91; angle <= 270; angle++ )
    {
      array_index = angle-91;
      theta[array_index] = angle*(M_PI_F/180); // in radiants
       //printf("%d ,", theta[angle-91] );
       xc[array_index] = round(r*cos(theta[array_index])) + x0;
       yc[array_index] = round(r*sin(theta[array_index])) + y0;
       //printf("\narrayIndex: %d, cartX: %d, cartY: %d\n", array_index, xc[array_index], yc[array_index]);
       //out[yc[array_index]*n + xc[array_index]] = 1.0;
    }
    //printf("\nx0: %d, y0: %d\n", x0, y0);
     // for testing
     /*
    for(int i = 0; i < n; i++)
    {
      for (int j = 0; j < n; j++)
      {
          printf("%.0f, ", out[i*n + j]);
      }
      printf("\n");
    }
    */
}

// Computes the coordinates of a straight line segment extending from center (x1, y1), to (x2, y2).
void intline(gint32 x1, gint32 y1, gint32 x2, gint32 y2, gfloat* sangElement, float* out)
{
    gint32 n = x1*2;
    gint32 flip = 0;
    gfloat m = 0.0;

    gint32 dx = abs(x2 - x1);
    gint32 dy = abs(y2 - y1);
    // no line to draw
    if((dx == 0) && (dy == 0))
    {
        x2 = x1;
        y2 = y1;
        return;
    }

    /*
    for(int i = 0; i < n; i++)
    {
      for (int j = 0; j < n; j++)
      {
          out[i*n + j] = 0.0;
      }
    }
    */
    // always take the longer variable, otherwise approximation of the line would be worse
    if(dx >= dy)
    {
        //printf("\nfirst\n");
        if(x1 > x2)
        {
            // swap x1 with x2, and y1 with y2 to always draw from (x1,y1) to (x2,y2), left to right
            gint32 temp;
            temp = x1; x1 = x2; x2 = temp;
            temp = y1; y1 = y2; y2 = temp;
            flip = 1;
        }
        //printf("\nx1,y1: %d, %d | x2,y2: %d, %d\n", x1, y1, x2, y2);
        // calculate gradient
        m = (gfloat)(y2 - y1) / (x2 - x1);
        //printf("\nm = %.2f\n", m);
        // create an array X of length dx which has all values between x1 and x2
        // TODO: replace malloc with 2*N static array, could be faster
        gint32 *x_coord = (gint32 *)g_malloc((dx+1) * sizeof(gint32));
        gint32 *y_coord = (gint32 *)g_malloc((dx+1) * sizeof(gint32));
        //printf("\n Output of sang:\n");

        //printf("\nx_coord:");
        //printf("\ny_coord:");
        //*sangElement = 0.0f;
        //printf("\nTODO: x1: %d y1: %d \n", x1, y1);
        //printf("\nTODO: x2: %d y2: %d \n", x2, y2);

        for(gint32 i = 0; i <= dx; i++)
        {
            //printf("%d,%d | ", x_coord[i], y_coord[i]);
            x_coord[i] = x1 + i;
            y_coord[i] = round(y1 + m*(x_coord[i]-x1));
            //printf("\nx: %d, y: %d\n", x_coord[i], y_coord[i]);
            //out[y_coord[i]*n + x_coord[i]] = 1.0;
            *sangElement += out[y_coord[i]*n + x_coord[i]];
        }
        //printf("\n");
        //printf("\n...END...\n");

        /*
        for(int i = 0; i < n; i++)
        {
           for (int j = 0; j < n; j++)
           {
               printf("%.0f, ", out[i*n + j]);
           }
           printf("\n");
        }
        */
        g_free(x_coord);
        g_free(y_coord);
        // create another array Y of length dx which calculates y = round(y1 + m*(x - x1)) for all values in X
    }
    else
    {
        //printf("\nsecond\n");
        if(y1 > y2)
        {
            // swap x1 with x2, and y1 with y2 to always draw from (x1,y1) to (x2,y2)
            gint32 temp;
            temp = x1; x1 = x2; x2 = temp;
            temp = y1; y1 = y2; y2 = temp;
            flip = 1;
        }
        //printf("\nx1,y1: %d, %d | x2,y2: %d, %d\n", x1, y1, x2, y2);
        // calculate slope
        m = (gfloat)(x2 - x1) / (y2 - y1);
        // x = round(x1 + m*(y - y1));
        gint32 *y_coord = (gint32 *)malloc((dy+1) * sizeof(gint32));
        gint32 *x_coord = (gint32 *)malloc((dy+1) * sizeof(gint32));

        //  printf("\nx_coord:");
        //printf("\n Output of sang:\n");
        //*sangElement = 0.0f;
        //printf("\nTODO: x1: %d y1: %d \n", x1, y1);
        //printf("\nTODO: x2: %d y2: %d \n", x2, y2);
        for(gint32 i = 0; i <= dy; i++)
        {
            y_coord[i] = y1 + i;
            x_coord[i] = round(x1 + m*(y_coord[i]-y1));
            //out[y_coord[i]*n + x_coord[i]] = 1.0;
            //printf("\nx: %d, y: %d\n", x_coord[i], y_coord[i]);
            *sangElement += out[y_coord[i]*n + x_coord[i]];
        }
        //printf("\n...END...\n");
        /*
        for(int i = 0; i < n; i++)
        {
          for (int j = 0; j < n; j++)
          {
              printf("%.0f, ", out[i*n + j]);
          }
          printf("\n");
        }
        */
        free(x_coord);
        free(y_coord);
      }
}

